import $ from "jquery";
import Button from 'components/Button';

// FUNCTIONS

function Testeo () {

	function clickTesteo(state) {
		console.log( `TestoLog` );
		let loTesteado = $( "input.input_test" ).val();
		console.log( `Test: ${ loTesteado }` );
		const cars = ["Saab", "Volvo", "BMW"];
		state( cars )
	};

	return (
		<div className="testeo">
			<div>
				<label>Testito</label>
				<input className="input_test" type="text" placeholder="Ingresa algo pal testsssss" />
			</div>
			<Button onClick={clickTesteo} laclase="primary" texto="BUSCAR" />
		</div>
	);
};

export default Testeo;
